import { BrowserRouter, Route, Routes } from 'react-router-dom';
import React from 'react';
import HomeComp from './component/homePage/homeComp';
import LoginComp from './component/loginPage/loginComp';
import CalendarComp from './component/calendarPage/calendarComp';
import NavbarComp from './component/navbar/navbar';
import PrivateRoute from './privateRoute';

function App() {
  const DefaultContainer = () => (
    <div>
        <NavbarComp />
        <Route path="/main" component={Main} />
        <Route path="/user" component={User} />
        <Route path="/hw-setting" component={Setting} />
        <Route path="/hw-detail/:id" component={HwDetail} />
        <Route path="/gas-detail/:id" component={GasDetail} />
    </div>
  )

  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route exact path = "/" element = { <LoginComp /> }></Route>

          <Route element = { <PrivateRoute /> } >

          </Route>

          <Route path = "*" element = {<main style = {{ padding: "1rem" }}><p>Nothing here</p></main>} />
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
